window.CUCUMBER_MESSAGES = [{"meta":{"protocolVersion":"18.0.0","implementation":{"name":"cucumber-jvm","version":"7.4.1"},"runtime":{"name":"OpenJDK 64-Bit Server VM","version":"18.0.1+10"},"os":{"name":"Windows 10"},"cpu":{"name":"amd64"}}},{"testRunStarted":{"timestamp":{"seconds":1659174810,"nanos":591594600}}},{"source":{"uri":"file:///C:/Users/mindc1may251/OneDrive/comprehensive-workspace/tide-bdd/src/test/java/com/pg/tide/features/test.feature","data":"#Author: your.email@your.domain.com\n#Keywords Summary :\n#Feature: List of scenarios.\n#Scenario: Business rule through list of steps with arguments.\n#Given: Some precondition step\n#When: Some key actions\n#Then: To observe outcomes or validation\n#And,But: To enumerate more Given,When,Then steps\n#Scenario Outline: List of steps for data-driven as an Examples and <placeholder>\n#Examples: Container for s table\n#Background: List of steps run before each of the scenarios\n#\"\"\" (Doc Strings)\n#| (Data Tables)\n#@ (Tags/Labels):To group Scenarios\n#<> (placeholder)\n#\"\"\n## (Comments)\n#Sample Feature Definition Template\n@tag\nFeature: Tide Automation Testing\n Testing the tide website with the bdd cucumber\n\n  @test1 @now\n  Scenario: User registration functionality check\n  \tGiven I am on the tide homepage\n    When I click on the Register link following it I click on signup\n    And I enter my credential and click on create account\n    Then my account is created with a successfull account creation messsage\n    \n   @test2 \n   Scenario: User login functionality check\n    Given I am on the tide homepage\n    And I click on the Register link following it I click on signup\n    And I click on the login link on the pg page\n    When I enter my credential and click on Login button\n    Then my account is logged in with a successfull validation by user name visibility\n    \n   @test3 \n   Scenario: Check language check functionality\n    Given I am on the tide homepage\n    When I click on the US-english language button on top\n    And I choose Canada french as language from the popup\n    Then the language is changed to canada french\n    \n   @test4 \n   Scenario: Check for custom stain among many stain types\n    Given I am on the tide homepage\n    When I click on the cant find stain link\n    And I search Grease as the stain type and click on the result\n    Then I am on the article for Grease stain removal\n\n\t @test5 \n\t Scenario: Calculate savings after switching to cold water\n\t\tGiven I am on the tide homepage\n    When I click on savings sticky banner\n    And I enter ten in the number of washes\n    Then I am shown my savings for ten cold washes\n    \n    @test6 \n    Scenario: Check for contact options availability on ContactUs Page\n    Given I am on the tide homepage\n    When I click on contact us link\n    Then I am able to see different ways to contact\n   \n    @test7 \n    Scenario: Search for pods and find result related to it \n    Given I am on the tide homepage\n    When I search for pods\n    Then I am able to product related to pods in the search result\n    \n    @test8 \n    Scenario: Check for working status of part companies websites of Tide \n    Given I am on the tide homepage\n    When I open all the part company websites using the logos on the homepage\n    Then correct websites of the part companies are loaded\n    \n    @test9 @now\n    Scenario: Start a live chat if the chat sevice is available\n    Given I am on the tide homepage\n    When I click on the Live chat link and go to chat window if Start Chat button is available\n    And I enter the required details and go through the flow\n    Then I am in a live chat session with the representative\n    \n    @test10 \n    Scenario: Browse by Need for Freshness/Scent products\n    Given I am on the tide homepage\n    When I click on Browse by Need and click on Freshness/Scent from the popup\n    Then I am redirected to Freshness Page where I find the product related to freshness\n    \n ","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/mindc1may251/OneDrive/comprehensive-workspace/tide-bdd/src/test/java/com/pg/tide/features/test.feature","feature":{"location":{"line":20,"column":1},"tags":[{"location":{"line":19,"column":1},"name":"@tag","id":"3d31e382-0d50-4e90-8a85-2b7b52f6f84c"}],"language":"en","keyword":"Feature","name":"Tide Automation Testing","description":" Testing the tide website with the bdd cucumber","children":[{"scenario":{"location":{"line":24,"column":3},"tags":[{"location":{"line":23,"column":3},"name":"@test1","id":"19020b3f-20e0-4f08-af44-907ee42f6a5f"},{"location":{"line":23,"column":10},"name":"@now","id":"d8b98d83-cf93-471c-bcd8-330f2ab855f1"}],"keyword":"Scenario","name":"User registration functionality check","description":"","steps":[{"location":{"line":25,"column":4},"keyword":"Given ","text":"I am on the tide homepage","id":"36485ad7-9c06-49eb-802f-e82978150471"},{"location":{"line":26,"column":5},"keyword":"When ","text":"I click on the Register link following it I click on signup","id":"9cfc42ed-b85c-481e-94c7-756a8d1f94de"},{"location":{"line":27,"column":5},"keyword":"And ","text":"I enter my credential and click on create account","id":"8c27e4ac-61e3-42e7-88fc-67b412f58b24"},{"location":{"line":28,"column":5},"keyword":"Then ","text":"my account is created with a successfull account creation messsage","id":"9fe1650d-818c-4105-9963-602d86e631ae"}],"examples":[],"id":"294213bb-a4b5-4612-8bea-a30836f9c4e3"}},{"scenario":{"location":{"line":31,"column":4},"tags":[{"location":{"line":30,"column":4},"name":"@test2","id":"41d4c8a3-78e6-4443-a458-f40d00a8c081"}],"keyword":"Scenario","name":"User login functionality check","description":"","steps":[{"location":{"line":32,"column":5},"keyword":"Given ","text":"I am on the tide homepage","id":"2797430e-70d4-4de0-ba1d-f55f873a7268"},{"location":{"line":33,"column":5},"keyword":"And ","text":"I click on the Register link fo
